import React, { useState } from "react";
import { Layout, Menu } from 'antd';
import {
  LineChartOutlined,
  FormOutlined,
  OrderedListOutlined,
  BellOutlined,
  UsergroupAddOutlined
} from '@ant-design/icons';
import 'antd/dist/antd.css';
import '../../global.css';

const { Sider } = Layout;
const { SubMenu } = Menu;

function MenuSite(props){
	return(
		    <Sider className="menu" trigger={null} collapsible collapsed={props.open}>
          <div className="logo" />
          <Menu className="menu" mode="inline" defaultSelectedKeys={['1']}>
            <Menu.Item key="1" icon={<LineChartOutlined />}>
              Relat√≥rio
            </Menu.Item>

            <Menu.Item key="2" icon={<UsergroupAddOutlined />}>
              Meus clientes
            </Menu.Item>

            <Menu.Item key="3" icon={<BellOutlined />}>
              Pedidos
            </Menu.Item>

            <Menu.Item key="4" icon={<ShopOutlined />}>
              Pdv
            </Menu.Item>

            <SubMenu key="sub1" icon={<FormOutlined />} title="Cadastros">
              <Menu.Item key="sub1-1">Produto</Menu.Item>
              <Menu.Item key="sub1-2">Categoria</Menu.Item>
              <Menu.Item key="sub1-3">Tamanho</Menu.Item>
              <Menu.Item key="sub1-4">Borda</Menu.Item>
            </SubMenu>

            <SubMenu key="sub2" icon={<OrderedListOutlined />} title="Listagens">
              <Menu.Item key="sub2-1">Produtos</Menu.Item>
              <Menu.Item key="sub2-2">Categorias</Menu.Item>
              <Menu.Item key="sub2-3">Tamanhos</Menu.Item>
              <Menu.Item key="sub2-4">Bordas</Menu.Item>
            </SubMenu>


          </Menu>
        </Sider>
	);
}

export default MenuSite;
